import React from "react";
import "./AboutMe.css";

const AboutMe = () => {
  const faqs = [
    {
      question: "What does this app do?",
      answer:
        "TerpsCook generates recipes based on the ingredients you have at home. Simply input your ingredients, select a meal type, and let the app provide you with creative ideas!"
    },
    {
      question: "How do I save my favorite recipes?",
      answer:
        "Once you generate a recipe, click the 'Save Recipe' button. You can view all your saved recipes in the 'Saved Recipes' section."
    },
    {
      question: "What meal types are supported?",
      answer:
        "You can generate recipes for breakfast, lunch, dinner, and desserts. It's designed to suit any time of the day!"
    }
  ];

  const teamMembers = [
    {
      name: "Mahi Thakkar",
      github: "https://github.com/mahithakkar",
      linkedin: "https://www.linkedin.com/in/mahi-thakkar/",
      bio: "Mahi contributed to the design and layout of the app, ensuring a seamless user experience."
    },
    {
      name: "Savya Miriyala",
      github: "https://github.com/msavya",
      linkedin: "https://www.linkedin.com/in/savya-miriyala/",
      bio: "Savya worked on the backend, integrating recipe generation logic with user inputs."
    },
    {
      name: "Sophia Jin",
      github: "https://github.com/sophiajinn",
      linkedin: "https://www.linkedin.com/in/sophia-jin/",
      bio: "Sophia handled full-stack tasks, ensuring smooth communication between frontend and backend."
    }
  ];

  return (
    <div className="about-container">
      {/* App Description */}
      <h1>About TerpsCook</h1>
      <p className="description">
        TerpsCook is a simple, efficient tool that helps you cook smarter and waste less. 
        By leveraging AI, it suggests recipes based on the ingredients you already have, 
        bringing convenience and creativity into your kitchen.
      </p>

      {/* How to Use the App */}
      <h2>How to Use This App</h2>
      <p className="how-to">
        1. Sign up or log in to your account.<br />
        2. Enter the ingredients you have on hand.<br />
        3. Choose a meal type: breakfast, lunch, dinner, or dessert.<br />
        4. Generate a recipe and save your favorites!
      </p>

      {/* FAQs */}
      <h2>FAQs</h2>
      <div className="faqs">
        {faqs.map((faq, index) => (
          <div key={index} className="faq-item">
            <h3>{faq.question}</h3>
            <p>{faq.answer}</p>
          </div>
        ))}
      </div>

      {/* Team Section */}
      <h2>Meet the Team</h2>
      <div className="team-grid">
        {teamMembers.map((member, index) => (
          <div key={index} className="team-card">
            <h3>{member.name}</h3>
            <p>{member.bio}</p>
            <div className="links">
              <a href={member.github} target="_blank" rel="noopener noreferrer">
                GitHub
              </a>
              {" | "}
              <a href={member.linkedin} target="_blank" rel="noopener noreferrer">
                LinkedIn
              </a>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AboutMe;
